-- ----------------------------
-- Procedure structure for generate_merchants
-- ----------------------------
DROP PROCEDURE IF EXISTS `generate_merchants`;
delimiter ;;
CREATE PROCEDURE `generate_merchants`()
BEGIN
  DECLARE i INT DEFAULT 1;
  WHILE i <= 1000 DO
      phone, 
      password, 
      merchant_name, 
      contact_name, 
      community, 
      qualification_status, 
      is_open
    ) VALUES (
      CONCAT('1390000', LPAD(i, 4, '0')),  -- 账号：13900000001
      '123456',                            -- 密码
      CONCAT('测试商家', i),                -- 商家名
      CONCAT('店长', i),                    -- 联系人
      '悦景小区',                           -- 社区
      1,                                   -- 已认证
      1                                    -- 营业中
    );
    SET i = i + 1;
  END WHILE;
END
;;
delimiter ;

